import React from 'react';
import Style from './setUp.module.scss';

export default function SetUp() {
	return (
		<div className={Style.modal}>
			<h1>Get Started</h1>
			<button>Set Weekly Goals</button>
			<button>Set Schedule</button>
		</div>
	);
}
